import React, { Component } from "react";

class Navbar extends Component {
  state = {};
  render() {
    return (
      <div styles={this.getstyles()}>
        <span>terve</span>
        <button>Uusi kalenteri</button>
      </div>
    );
  }

  getstyles() {
    let styles = "background-color: Blue ";
    return styles;
  }
}

export default Navbar;
